import './App.css';
// import App from './app/App';
import Login from '../pageComponents/Login';
import Start from '../pageComponents/Start';
import {BrowserRouter as Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Routes>
    <div className="App">
      <header className="App-header">
            <Route path="/login">
                <Login />
            </Route>
            <Route path="/start">
                <Start />
            </Route>
      </header>
    </div>
    </Routes>
  );
}

export default App;
